///A never fired/// M1A Scout/ Squad with Walnut stock.  The Scout will come with (6) mags total, (5) are USGI and the stock mag seen in the picture. 
If a composite stock is preferred I have a SOCOM 16 I can swap stocks with; however, the composite stock has not been babied.  
I like the scout and really don't care to sell.

I have Independence, Magtech and Federal American Eagle brands to trade;

3-50 rd. boxes for every 525 rd. Value Pack. It you want to do a fair trade let me know what you have and we'll haggle from there. I know the value packs vary in size depending on brand.

Thanks.
